INSERT INTO complaint VALUES ('75', 'R11TS210056', 'ขอใช้บริการ', 'ดำเนินการเสร็จเรียบร้อย', 'แจ้งการขอใช้งานอินเทอร์เน็ต\r\n -รหัสผู้ใช้ : pornnipha.w  (ภาษาอังกฤษตัวเล็กเท่านั้น)\r\n -รหัสผ่าน : 12345678 \r\n* ผู้ขอใช้งานอินเทอร์เน็ตรายใหม่ ต้องเปลี่ยนรหัสผ่านทันทีที่เข้าใช้งานครั้งแรก โดยทำตามขั้นตอน ดังนี้ \r\n   1. ใส่รหัสผู้ใช้ – รหัสผ่าน แล้วทำการ Chang Password ก่อน\r\n   2. กรอกรายละเอียดให้ครบ\r\n      - ใส่รหัผผู้ใช้ (ตามที่แจ้ง) \r\n      - ใส่รหัสผ่านเดิม (12345678)\r\n      - ใส่รหัสผ่านใหม่ (ไม่ต่ำกว่า 7 ตัวอักษร)\r\n      - ยืนยันรหัสผ่าน\r\n   3. เมื่อกรอกรายละเอียดครบแล้ว ระบบจะแจ้งยืนยันการเปลี่ยนรหัสผ่าน\r\n   4. ปิดหน้าต่างทั้งหมด (รอสักครู่) แล้วเปิดหน้าต่างเข้าใช้อินเทอร์เน็ตใหม่\r\n   5. นำรหัสผ่านใหม่ มาเข้าใช้งาน  \r\n** หากยังไม่มีการยืนยันการเปลี่ยนรหัสผ่านจะไม่สามารถเข้าใช้งานอินเทอร์เน็ตได้\r\n', '2011-09-27 13:59:03', '2011-09-28 09:43:25', '2011-09-28 10:18:38', '109', null, null, 'no', null, '');
