INSERT INTO complaint VALUES ('287', 'R12TS160013', 'แจ้งปัญหา', 'ดำเนินการเสร็จเรียบร้อย', 'เนื่องงจากพื้นที่ในการใช้งานของเมล์ชื่อ children.fund@m-society.go.th เต็มหรือเหลือน้อยเกินกว่าจะรับ-ส่งเมล์ได้ จึงเป็นสาเหตุที่ทำให้ไม่สามารถส่งเมล์เข้า children.fund ได้ ผู้ดูแลเมล์ children.fund จะต้องทำการลบเมล์ในถังขยะออก (เป็นลำดับแรก) เพื่อเพิ่มพื้นที่ในการรับ-ส่ง เพราะถ้าไม่ลบเมล์ในถังขยะ เท่ากับว่าเมล์นั้นๆ ยังสำรองข้อมูลไว้ใช้งานตลอดเวลา (ทำให้เปลืองพื้นที่ในการรับ-ส่งเมล์) แล้วจึงลบเมล์จากกล่องจดหมายเข้า, ส่งจดหมาย, ร่างจดหมาย, หรือโฟรเดอร์อื่นที่เก็บเมล์ที่ไม่จำเป็นแล้วไว้ และเมื่อลบแล้วให้ตามมาลบที่ถังขยะอีกครั้ง ซึ่งการลบเมล์ในถังขยะจะเป็นการลบแบบถาวรไม่สามารถเรียกเมล์นั้นกลับใช้งานได้อีก ซึ่งขณะนี้ผู้ดูแลระบบเมล์ได้เพิ่มพื้นที่การใช้งานให้กับ children.fund@m-society.go.th เป็นการชั่วคราวเพื่อให้สามารถเข้าไปใช้งานเมล์ได้ และจะทำการลดพื้นที่เมล์ให้เหลือเท่าเดิม (300MB) ในวันศุกร์ที่ 25 พ.ค. 55', '2012-05-21 10:32:30', '2012-05-21 13:56:44', '2012-05-21 14:26:17', '190', null, null, 'no', null, '');
