INSERT INTO complaint VALUES ('342', 'R12TS210287', 'ขอใช้บริการ', 'ดำเนินการเสร็จเรียบร้อย', 'แจ้งการขอใช้งานอินเทอร์เน็ตกระทรวงฯ\r\nเนื่องจากได้ตรวจสอบข้อมูลในระบบผลปรากฏว่า \"ผู้ขอใช้\" มี User (thanakorn.c) & Password ในการเข้าใช้งานแล้ว (ตั้งแต่ยังเป็นเลขานุการผู้ตรวจฯ) และยังไม่ได้มีการขอยกเลิกออกจากระบบ ซึ่ง User & Password ที่มีสามารถนำไปใช้ได้ทุกหน่วยงานที่อยู่ในสังกัด สป.พม. (ทั้ง 3 ที่คือสะพานขาว บ้านราชวิถี และตึกซีพี) และบางหน่วยงานของ พส. ที่อยู่ในบ้านราชวิถีแล้วขอใช้งานระบบอินเทอร์เน็ตจาก ศทส. ', '2012-09-10 14:39:31', '2012-09-11 14:50:12', '2012-09-11 14:52:55', '216', null, null, 'no', null, '');
INSERT INTO complaint VALUES ('343', 'R12TS220287', 'ขอใช้บริการ', 'ดำเนินการเสร็จเรียบร้อย', 'แจ้งการขอใช้งานอีเมล์กระทรวงฯ\r\nเนื่องจากได้ตรวจสอบข้อมูลในระบบผลปรากฏว่า \"ผู้ขอใช้\" มี User & Password (thanakorn.c@m-society.go.th) ในการเข้าใช้งานอีเมล์แล้ว และยังไม่ได้มีการขอยกเลิกการใช้งาน ซึ่งระบบจะอนุญาตให้ใช้งานได้จนกว่าจะเกษียณอายุราชการหรือเจ้าหน้าที่จะดำเนินการลบ User เมื่อมีการย้ายไปสังกัดหน่วยงานอื่นที่ไม่ใช่กระทรวงการพัฒนาสังคมฯ โดยจะมีอีเมล์แจ้งล่วงหน้าอย่างน้อย 1 อาทิตย์', '2012-09-10 14:39:53', '2012-09-11 14:49:13', '2012-09-11 15:06:17', '216', null, null, 'no', null, '');
