INSERT INTO complaint VALUES ('386', 'R12TS110018', 'แจ้งปัญหา', 'ดำเนินการเสร็จเรียบร้อย', 'ไม่ต้องทำอะไรมาก ถ้าไม่สามารถจำอะไรได้เลยเกี่ยวกับการใช้ Internet ของกระทรวง ก็แจ้งกับเจ้าหน้าที่ คุณประทุมรัตน์ ผ่านระบบก็ได้ ว่าให้ set password ให้ใหม่\r\nเมื่อได้รหัส แล้ว เพื่อความปลอดภัยในการเข้าใช้ ก็กรุณาตั้งรหัสใหม่ทันที (และจำให้ได้) หลักการตั้งรหัส คงไม่ต้องบอกว่าตั้งแบบไหน\r\nและ รหัสดังกล่าว ไม่ว่าจะเข้าที่ สะพานขาว บ้านราช หรือ ซีพี ก็ใช้ตัวเดียวกันทุกที  จึงแจ้งมาเพือทำความเข้าใจอีกครั้งหนึ่ง( อวยพร ผู้ตอบ)', '2012-11-08 12:42:04', null, '2012-11-08 13:36:56', '216', null, null, 'no', null, '');
INSERT INTO complaint VALUES ('387', 'R12TS210321', 'ขอใช้บริการ', 'ดำเนินการเสร็จเรียบร้อย', 'แจ้งการขอใช้งานอินเทอร์เน็ต\r\n\r\n1.การใช้บริการอินเทอร์เน็ต ของ สป.พม. จะให้สิทธิ์เฉพาะบุคลากรของ สป.พม. เท่านั้น\r\n\r\n2.หากท่านไม่ได้อยู่ใน สป.พม. และมีความประสงค์จะใช้บริการอินเทอร์เน็ต ทางผู้ดูแลระบบจะกำหนดสิทธิ์การใช้งานให้ท่าน ดังนี้\r\n\r\n   2.1 สามารถใช้งานอินเทอร์เน็ต ของ สป.พม. ได้ไม่เกิน 6 เดือน โดยกำหนดเป็นรอบ คือ\r\n           รอบที่ 1 ตั้งแต่วันที่ 1 ตุลาคม - 31 มีนาคม\r\n           รอบที่ 2 ตั้งแต่วันที่ 1 เมษายน - 30 กันยายน\r\n\r\n   2.2 สามารถใช้งานอินเทอร์เน็ต ของ สป.พม. ได้เฉพาะวันจันทร์ - วันศุกร์ ตั้งแต่เวลา 06.00 น. - 18.00 น. \r\n\r\n3. -รหัสผู้ใช้ : luksana.i  (ภาษาอังกฤษตัวเล็กเท่านั้น)\r\n -รหัสผ่าน : 12345678 \r\n* ผู้ขอใช้งานอินเทอร์เน็ตรายใหม่ ต้องเปลี่ยนรหัสผ่านทันทีที่เข้าใช้งานครั้งแรก โดยทำตามขั้นตอน ดังนี้ \r\n   1. ใส่รหัสผู้ใช้ – รหัสผ่าน แล้วทำการ Chang Password ก่อน\r\n   2. กรอกรายละเอียดให้ครบ\r\n      - ใส่รหัผผู้ใช้ (ตามที่แจ้ง) \r\n      - ใส่รหัสผ่านเดิม (12345678)\r\n      - ใส่รหัสผ่านใหม่ (ไม่ต่ำกว่า 7 ตัวอักษร)\r\n      - ยืนยันรหัสผ่าน\r\n   3. เมื่อกรอกรายละเอียดครบแล้ว ระบบจะแจ้งยืนยันการเปลี่ยนรหัสผ่าน\r\n   4. ปิดหน้าต่างทั้งหมด (รอสักครู่) แล้วเปิดหน้าต่างเข้าใช้อินเทอร์เน็ตใหม่\r\n   5. นำรหัสผ่านใหม่ มาเข้าใช้งาน  \r\n** หากยังไม่มีการยืนยันการเปลี่ยนรหัสผ่านจะไม่สามารถเข้าใช้งานอินเทอร์เน็ตได้', '2012-11-08 13:42:50', null, '2012-11-08 14:32:45', '235', null, null, 'no', null, '');
