INSERT INTO complaint_ask VALUES ('32', '372', '62', 'เนื่องจากผู้ขอใช้งานระบบอินเทอร์เน็ต ไม่ได้ทำการกรอกข้อมูลให้ถูกต้อง (ในช่อง Name & Surname) ผู้ดูแลระบบจึงไม่สามารถทำการ Add Internet Account ให้ได้', '2012-10-17 16:44:06');
INSERT INTO complaint_ask VALUES ('33', '401', '196', 'พม/สป-กสค/13-01/02/2548  อินเตอร์เน็ตใช้ไม่ได้ คอมเข้าระบบล๊อคอินของกระทรวงฯไม่ได้  เลียงจากคอมไม่ขึ้น คอมชอบแฮงค์บ่อยๆๆ', '2012-12-13 12:56:30');
INSERT INTO complaint_ask VALUES ('34', '392', '196', 'คอมแฮงค์บ่อย ต้อง reset ใหม่,เข้าอินเตอร์เน็ตไม่ได้,เสียงจากในเครื่องไม่ขึ้น', '2012-12-13 14:05:47');
INSERT INTO complaint_ask VALUES ('35', '423', '88', 'เป็นเครื่องนอกประกัน เครื่องมีการทำงานช้า ได้เข้าไปจัดการลบขยะ จัดเรียงข้อมูล สแกนดิส แล้วแจ้งเขาให้เก็บข้อมูลที่จำเป็นไว้ถ้ามีปัญหาอีกจะทำการติดตั้งระบบปฏิบัติการให้ใหม่', '2013-01-30 13:44:56');
