INSERT INTO complaint_problem VALUES ('437', '1', '1', 'พม/สป-กบท', 'พม/สป-กบม/13-01-03/005/2554\r\nขอลงโปรแกรมใหม่ เนื่องจาก เครื่องมีปัญหาที่ CPU มีเสียงดัง และเปาลมเย็นออกมาเหมือนพัดลม ทำให้ระบบการทำงานของเครืองหยุดทำงานอาทิตละประมาณ 3 ครั้ง ปัญหา save งานไม่ได้บ่อยครั้ง internet ทุกครั้งที่จะเข้า net จะต้องทำการ restart เครื่องทุกครั้งจึงจะสามารถเข้าใช้งานได้ และมีปัญหาเครื่องอืด เครื่องค้างเป็นประจำค่ะ ติดต่อ น้องปั๋ง กบท 02-2029024 ขอบคุณค่ะ', '', '', '///', '', null, '////', '', '', '', null, '', '////', '', '');
INSERT INTO complaint_problem VALUES ('439', '1', '0', 'swc_sc0152', 'ช่วยมาลงแผ่นโปรแกรมเครื่องสแกนด้วยนะ  จะยกเครื่องใช้ไปใช้กับเครื่อง PC อีกเครื่องค่ะ ', '', '', '///', '', null, '////', '', '', '', null, '', '////', '', '');
INSERT INTO complaint_problem VALUES ('440', '1', '1', '', 'เครื่อง Sleep เวลาที่พักหน้าจอเอาไว้เวลา ครึ่งชั่วโมง แล้วดับไปเลยไม่สามารถเข้าใช้งานได้ ต้องตัดสำรองไฟแล้วเปิดเครื่องใหม่ตลอดเวลา และเครื่องติดไวรัส ซ่อมด่วนค่ะ', '', '', '///', '', null, '////', '', '', '', null, '', '////', '', '');
