INSERT INTO faq VALUES ('1', 'F001', '1', 'ไม่สามารถตั้งค่า wireless ได้', '<br />\r\n1. ตรวจสอบที่เครื่องคอมพิวเตอร์ว่าเปิดสัญญาณ wireless แล้วหรือยัง?&nbsp;<br />\r\n2. ตรวจสอบสัญญาณที่เครื่อง Access Point ว่ามีสัญญาณไฟติดหรือไม่?<br />\r\n3. ถ้าทั้งสองข้อสามารถใช้งานได้ ให้เลือก ชื่อ ของ Access Point ที่ต้องการ<br />\r\n4. กดปุ่ม เพื่อ Connect<br />\r\n<img alt=\"\" src=\"http://crm.m-society.go.th/include/fckeditor/editor/images/smiley/msn/wink_smile.gif\" /><br type=\"_moz\" />');
