INSERT INTO news VALUES ('1', '<h3><small><span style=\"color: rgb(0, 0, 255); \"><span style=\"background-color: lime; \"><big>เรียน เจ้าหน้าที่ สป.พม. ส่วนกลางและส่วนภูมิภาค ทุกท่าน</big></span><big><br />\r\n</big><span style=\"background-color: lime; \"><big>ขณะนี้ ศทส. มีระบบรับแจ้งปัญหาทางออนไลน์ ซึ่งจะเริ่มใช้งาน</big></span><span style=\"background-color: yellow; \"><big>&nbsp;</big></span></span></small><span style=\"color: rgb(0, 0, 255); \"><span style=\"background-color: yellow; \">ในปีงบประมาณ 2555 เป็นต้นไป ดังนี้</span></span><span style=\"background-color: rgb(255, 255, 0); \"><span style=\"background-color: rgb(0, 255, 0); \"><br />\r\n</span></span><span style=\"background-color: rgb(0, 255, 255); \"><small><big><span style=\"color: rgb(0, 0, 255); \"><span style=\"color: rgb(0, 0, 0); \">1.</span></span></big></small></span><small><span style=\"background-color: lime; \"><big><span style=\"color: rgb(0, 0, 255); \"><span style=\"background-color: rgb(204, 255, 255); \"><span style=\"color: rgb(0, 0, 0); \">แจ้งซ่อมเครื่องคอมพิวเตอร์และอุปกรณ์ รวมทั้งอินเทอร์เน็ต (เฉพาะส่วนกลาง)<br />\r\n<span style=\"background-color: rgb(0, 255, 255); \">2.</span>สมัคร/ยกเลิก การใช้บริการ Internet,Email,MsoChat และ WebHosting<br />\r\n<span style=\"background-color: rgb(0, 255, 255); \">3.</span>แจ้งปัญหาการใช้งานระบบเครือข่าย (สนง.พมจ.)</span></span></span></big></span></small><span style=\"background-color: lime; \"><big><span style=\"color: rgb(0, 0, 255); \"><span style=\"background-color: rgb(51, 51, 51); \"><br />\r\n</span> </span><small><span style=\"color: rgb(255, 0, 0); \"><span style=\"background-color: rgb(255, 255, 255); \">โดยทุกท่านจะต้องสมัครสมาชิกก่อน จึงจะทำการแจ้งเรื่องได้ และ ศทส.จะพิจารณารับเรื่องที่แจ้งทางระบบนี้ก่อนเป็นลำดับแรกของการให้บริการต่างๆ แก่ทุกท่าน</span></span></small><span style=\"color: rgb(255, 255, 255); \"><span style=\"background-color: rgb(255, 255, 0); \"><span style=\"background-color: rgb(255, 0, 0); \"><br />\r\n</span><small><span style=\"background-color: rgb(255, 0, 0); \">ขอบคุณทุกท่านที่ให้ความร่วมมือ <br />\r\nหากขัดข้องประการใด ขออภัยในความไม่สะดวกมา ณ โอกาสนี้</span></small></span></span></big></span></h3>\r\n<span style=\"background-color: rgb(255, 0, 0); \">^_______^</span><br />', '2012-03-07');
